import React, { Component } from "react";
import "../Styles/App.css";

class Header extends Component {
  render() {
    return (
      <header>
        <nav>
          <ul >
            <li><img src={require("../img/home.png")} aria-hidden="true" alt="Logo" /></li>
            <li><img src={require("../img/edit.png")} aria-hidden="true" alt="Logo" /></li>
            <li><img src={require("../img/user.png")} aria-hidden="true" alt="Logo"/></li>
          </ul>
        </nav>
      </header>
    );
  }
}

export default Header;
